@charset "utf-8";

.fa { font-family: var(--fa-style-family,"Font Awesome 6 Free"); font-weight: var(--fa-style,900); }

.fa, .fa-brands, .fa-classic, .fa-regular, .fa-sharp, .fa-solid, .fab, .far, .fas { -webkit-font-smoothing: antialiased; display: var(--fa-display,inline-block); font-style: normal; font-variant: normal; line-height: 1; text-rendering: auto; }

.fa-classic, .fa-regular, .fa-solid, .far, .fas { font-family: "Font Awesome 6 Free"; }

.fa-brands, .fab { font-family: "Font Awesome 6 Brands"; }

.fa-1x { font-size: 1em; }

.fa-2x { font-size: 2em; }

.fa-3x { font-size: 3em; }

.fa-4x { font-size: 4em; }

.fa-5x { font-size: 5em; }

.fa-6x { font-size: 6em; }

.fa-7x { font-size: 7em; }

.fa-8x { font-size: 8em; }

.fa-9x { font-size: 9em; }

.fa-10x { font-size: 10em; }

.fa-2xs { font-size: 0.625em; line-height: 0.1em; vertical-align: 0.225em; }

.fa-xs { font-size: 0.75em; line-height: 0.08333em; vertical-align: 0.125em; }

.fa-sm { font-size: 0.875em; line-height: 0.07143em; vertical-align: 0.05357em; }

.fa-lg { font-size: 1.25em; line-height: 0.05em; vertical-align: -0.075em; }

.fa-xl { font-size: 1.5em; line-height: 0.04167em; vertical-align: -0.125em; }

.fa-2xl { font-size: 2em; line-height: 0.03125em; vertical-align: -0.1875em; }

.fa-fw { text-align: center; width: 1.25em; }

.fa-ul { list-style-type: none; margin-left: var(--fa-li-margin,2.5em); padding-left: 0px; }

.fa-ul > li { position: relative; }

.fa-li { left: calc(var(--fa-li-width, 2em)*-1); position: absolute; text-align: center; width: var(--fa-li-width,2em); line-height: inherit; }

.fa-border { border-radius: var(--fa-border-radius,0.1em); border: var(--fa-border-width,0.08em) var(--fa-border-style,solid) var(--fa-border-color,#eee); padding: var(--fa-border-padding,0.2em 0.25em 0.15em); }

.fa-pull-left { float: left; margin-right: var(--fa-pull-margin,0.3em); }

.fa-pull-right { float: right; margin-left: var(--fa-pull-margin,0.3em); }

.fa-beat { animation-name: fa-beat; animation-delay: var(--fa-animation-delay,0s); animation-direction: var(--fa-animation-direction,normal); animation-duration: var(--fa-animation-duration,1s); animation-iteration-count: var(--fa-animation-iteration-count,infinite); animation-timing-function: var(--fa-animation-timing,ease-in-out); }

