------MultipartBoundary--4mI8kfBN9CTJA0fCZwuHCm22DzKCmBbKoHLlg8lkw0----
Content-Type: text/css
Content-Transfer-Encoding: binary
Content-Location: https://tikfollowers.com/theme/default/css/style.css

@charset "utf-8";

#rating_error_alert, .customer-submit-success { display: none; }

h1, .h1, .h1 { font-size: 2.625rem !important; }

h3, .h3, .h3 { font-size: 1.25rem !important; }

h4, .h4, .h4 { font-size: 1rem !important; }

input:-webkit-autofill, input:-webkit-autofill:focus { transition: background-color 600000s ease 0s, color 600000s ease 0s; }

input[data-autocompleted] { background-color: transparent !important; }

.text-black { color: rgb(0, 0, 0); }

.text-secondary-color { color: rgb(255, 0, 128); }

.all-menu-list .nav-link { font-weight: 600 !important; }

.dropdown-menu li a { text-align: left; display: block; width: 100%; }

.dropdown-menu li a i { width: 20px; font-size: 13px; border-right: 1px solid rgb(229, 229, 229); color: rgb(237, 5, 137); }

.dropdown-item:hover, .dropdown-item:focus { color: rgb(255, 255, 255) !important; background-color: rgb(163, 28, 180) !important; }

.dropdown-item { color: rgb(0, 0, 0) !important; }

.dropdown-menu li a:hover .text-secondary-color { color: rgb(255, 255, 255) !important; }

.dropdown-item:hover a, .dropdown-item:focus a { color: rgb(255, 255, 255) !important; }

.dropdown-item:hover a i, .dropdown-item:focus a i { color: rgb(255, 255, 255) !important; }

.dropdown .dropdown-menu .dropdown-item + .right-drop-menu.dropdown-menu { left: -302px; right: auto; }

.dropdown .right-drop-menu.dropdown-menu::before { right: -8px !important; left: auto !important; }

.dropdown .dropdown-menu .dropdown-item + .right-drop-menu.dropdown-menu::before { transform: rotate(90deg); right: 0px; top: 0px; z-index: -1; transition: left 0.35s ease 0s; }

.menu-big-right { right: 0px !important; }

.menu-big-right.dropdown-xl { min-width: 45rem !important; }

.dropdown .menu-big-right.dropdown-menu::before { right: 28px; left: auto; }

.all-menu-list .dropdown .dropdown-menu::before { right: auto; font-size: 26px; color: rgb(255, 255, 255); transition: top 0.35s ease 0s; content: ""; display: block; height: 0px; position: absolute; left: 10%; border-left: 8px solid transparent; border-right: 8px solid transparent; border-bottom: 10px solid rgb(255, 255, 255); width: 0px !important; top: -9px !important; }

.all-menu-list .menu-big-right.dropdown-menu::before { left: auto; font-size: 26px; color: rgb(255, 255, 255); transition: top 0.35s ease 0s; content: ""; display: block; height: 0px; position: absolute; right: 8%; border-left: 8px solid transparent; border-right: 8px solid transparent; border-bottom: 10px solid rgb(255, 255, 255); width: 0px !important; top: -9px !important; }

