.success-checkmark .check-icon { width: 80px; height: 80px; position: relative; border-radius: 50%; box-sizing: content-box; border: 4px solid rgb(76, 175, 80); }

.success-checkmark .check-icon::before { top: 3px; left: -2px; width: 30px; transform-origin: 100% 50%; border-radius: 100px 0px 0px 100px; }

.success-checkmark .check-icon::after { top: 0px; left: 30px; width: 60px; transform-origin: 0px 50%; border-radius: 0px 100px 100px 0px; animation: 4.25s ease-in 0s 1 normal none running rotate-circle; }

.success-checkmark .check-icon::before, .success-checkmark .check-icon::after { content: ""; height: 100px; position: absolute; background: rgb(255, 255, 255); transform: rotate(-45deg); }

.success-checkmark .check-icon .icon-line { height: 5px; background-color: rgb(76, 175, 80); display: block; border-radius: 2px; position: absolute; z-index: 10; }

.success-checkmark .check-icon .icon-line.line-tip { top: 46px; left: 14px; width: 25px; transform: rotate(45deg); animation: 0.75s ease 0s 1 normal none running icon-line-tip; }

.success-checkmark .check-icon .icon-line.line-long { top: 38px; right: 8px; width: 47px; transform: rotate(-45deg); animation: 0.75s ease 0s 1 normal none running icon-line-long; }

.success-checkmark .check-icon .icon-circle { top: -4px; left: -4px; z-index: 10; width: 80px; height: 80px; border-radius: 50%; position: absolute; box-sizing: content-box; border: 4px solid rgba(76, 175, 80, 0.5); }

.success-checkmark .check-icon .icon-fix { top: 8px; width: 5px; left: 26px; z-index: 1; height: 85px; position: absolute; transform: rotate(-45deg); background-color: rgb(255, 255, 255); }

@keyframes rotate-circle { 
  0% { transform: rotate(-45deg); }
  5% { transform: rotate(-45deg); }
  12% { transform: rotate(-405deg); }
  100% { transform: rotate(-405deg); }
}

@keyframes icon-line-tip { 
  0% { width: 0px; left: 1px; top: 19px; }
  54% { width: 0px; left: 1px; top: 19px; }
  70% { width: 50px; left: -8px; top: 37px; }
  84% { width: 17px; left: 21px; top: 48px; }
  100% { width: 25px; left: 14px; top: 45px; }
}

@keyframes icon-line-long { 
  0% { width: 0px; right: 46px; top: 54px; }
  65% { width: 0px; right: 46px; top: 54px; }
  84% { width: 55px; right: 0px; top: 35px; }
