@charset "utf-8";

.text-left { text-align: left; }

.text-right { text-align: right; }

.text-center { text-align: center; }

input:-webkit-autofill, input:-webkit-autofill:hover, input:-webkit-autofill:focus, textarea:-webkit-autofill, textarea:-webkit-autofill:hover, textarea:-webkit-autofill:focus, select:-webkit-autofill, select:-webkit-autofill:hover, select:-webkit-autofill:focus, input:-internal-autofill-selected { background-clip: text !important; }

.form-column { min-height: 250px; align-items: center; justify-content: center; overflow: hidden; padding: 3em; }

.home-alert, #form_loader, #followers_count_div, #counter_time_continue_btn { display: none; }

#user-loader { display: none; animation: 3s ease-in 0s 1 normal none running none; }

.loader-image { border: 5px solid transparent; width: 100px; z-index: 1; position: relative; }

.loader-spinner { width: 100px; height: 100px; padding: 10px; background: linear-gradient(rgb(255, 255, 255), rgb(255, 255, 255)) padding-box padding-box, linear-gradient(to right, rgb(238, 5, 137), rgb(158, 29, 182)) border-box border-box; border-radius: 50px; border: 3px solid transparent; }

.user_loader_welcome_text { display: none; width: max-content; }

.live-nub-box span { padding: 0.5rem; background: rgb(0, 182, 122); color: rgb(255, 255, 255); margin-right: 5px; border-radius: 5px; font-weight: bold; }

.timeline-over-box .timeline-one-side .timeline-step { left: 1rem; background: rgb(255, 255, 255); height: 40px; width: 40px; box-shadow: rgba(164, 38, 169, 0.19) 0px 3px 0px 0px; }

.success-ad-box { padding: 20px; background: rgb(239, 248, 239); border: 2px dashed rgb(165, 215, 167); margin-top: 20px; border-radius: 15px; overflow: hidden; position: relative; }

.waiting-text { padding: 20px; background: rgb(255, 255, 244); border: 2px dashed rgb(250, 206, 168); margin-top: 20px; border-radius: 15px; }

.post-limit-ad-box { padding: 20px; background: rgb(255, 255, 244); border: 2px dashed rgb(250, 206, 168); margin: 20px; border-radius: 15px; }

@media (max-width: 350px) {
  .bottom-icon-text p { font-size: 11px; }
}

@media (max-width: 450px) {
  .bottom-icon-text p { font-size: 13px; }
}

@media only screen and (max-width: 767px) and (min-width: 200px) {
  .form-column { padding: 1em; }
}

.hero-input .form-control:not(:last-child) { border-right: 1px solid rgb(211, 214, 218); border-top-right-radius: 0.5rem !important; border-bottom-right-radius: 0.5rem !important; }

.g-recaptcha { transform-origin: 0px 0px; transform: translate(8px, 10px) scale(0.77); }

.free-over-box { box-shadow: rgb(251, 166, 212) 0px 8px 26px -4px, rgba(20, 20, 20, 0.06) 0px 8px 9px -5px !important; border: 1px solid rgb(251, 166, 212) !important; }

.timer { margin-top: 10px; }

.timer > svg { width: 100px; height: 80px; }

.timer > svg > circle { fill: none; stroke-opacity: 0.3; stroke: rgb(247, 2, 132); stroke-width: 5; transform-origin: center center; transform: rotate(-90deg); }

.timer > svg > circle + circle { stroke-dasharray: 1; stroke-dashoffset: 1; stroke-linecap: round; stroke-opacity: 1; }

.timer.animatable > svg > circle + circle { transition: stroke-dashoffset 0.3s ease 0s; }

.timer > svg > text { font-size: 2rem; fill: rgb(226, 10, 82); }

.timer > svg > text + text { font-size: 1rem; }
